def decode(encoded_string, codebook):
    decoded_string = ''
    while len(encoded_string) > 0:
        for symbol in codebook:
            if encoded_string.startswith(codebook[symbol]):
                decoded_string += symbol
                encoded_string = encoded_string[len(codebook[symbol]):]
                break
        else:
            # If no symbol matches, there is an unexpected code in the encoded string.
            print(f"Unexpected code in encoded string: {encoded_string}")
            break
    decoded_string = decoded_string.replace(codebook[' '], ' ')
    return decoded_string

codebook = {'a': '00',
'b': '01',
'c': '10',
'd': '1100',
'e': '1101',
'f': '1110',
'g': '111100',
'h': '111101',
'i': '111110',
'j': '1111110000',
'k': '1111110001',
'l': '1111110010',
'm': '1111110011',
'n': '1111110100',
'o': '1111110101',
'p': '1111110110',
'q': '1111110111',
'r': '1111111000',
's': '1111111001',
't': '1111111010',
'u': '1111111011',
'v': '1111111100',
'w': '1111111101',
'x': '1111111110',
'y': '1111111111',
'z': '11111111110000',
' ': '11111111110001'}

encoded_string = " 1111111110001111101111110100111111111100011111111010111101110111111111110001111111011011110111111110000011111110011101"

# Remove all whitespace characters from the encoded string
encoded_string = ''.join(encoded_string.split())

decoded_string = decode(encoded_string, codebook)
print(decoded_string) # Output
